To terminate a C program, you can use the `exit()` function. The `exit()` function is defined in the `stdlib.h` header file and it allows you to terminate the program and return a status code.

Here's the basic syntax for using the `exit()` function:

```c
#include <stdlib.h>

int main() {
    // your program code here

    exit(status_code);
}
```

The `status_code` argument is an integer value that represents the exit status of the program. By convention, a status code of 0 indicates successful termination, while a non-zero value indicates an error or some other abnormal condition.

For example, to terminate the program with a successful exit status, you can use:

```c
exit(0);
```

And to terminate the program with an error status, you can use:

```c
exit(1);
```

Alternatively, you can also use the `return` statement at the end of the `main()` function to terminate the program. The `return` statement will automatically call the `exit()` function with the value you provide as the exit status. For example:

```c
int main() {
    // your program code here

    return 0; // successful termination
}
```

or

```c
int main() {
    // your program code here

    return 1; // error termination
}
```

Using the `exit()` function or the `return` statement at the end of the `main()` function are the two most common ways to terminate a C program.

